import axios from "axios";
import React, { useState } from "react";
import AuthService from "../../services/auth-service";

export default function UserSeries() {

    const [seriesList, setSeriesList] = useState([]);
    const user = AuthService.getCurrentUser();

    axios.get("https://api.betaseries.com/shows/member", {
        params : {
            id: user.user.id,
            client_id: "22f661bdce5c",
        }
    }).then(response => {
        //console.log(response.data.shows);
        setSeriesList(response.data.shows);
    })

    return(
        <div className="container content-center mx-auto">
            <div className="grid text-center grid-cols-3 gap-5 gap-x14 text-white">
                {seriesList.map(function(data) {
                    return(
                        <div className="serie-grid">
                            <img src={data.images.poster} alt="Serie" className="w-8/12" />
                        </div>
                    )
                })}
            </div>
        </div>
    )
}
